import React, { useState, useEffect } from 'react';

function NumberList() {
    const [numbersString, setNumbersString] = useState('');

    useEffect(() => {
        fetch('/api/numbers')
            .then(response => response.json())
            .then(data => setNumbersString(data.numbers))
            .catch(error => console.error('Error fetching numbers:', error));
    }, []);

    return (
        <div>
            <h2>Numbers String</h2>
            <p>{numbersString}</p>
        </div>
    );
}

export default NumberList;
